I am selling a vintage Ruger 10/22 carbine. I bought this gun when it was new in 1976 and have kept it in pristine condition. Has never had the top rail mounted to it, bluing is 100% and the stock is a beautiful full color straight grained American Walnut. This is the very rare 200th Year model, in like new condition, any serious collection will not be complete without one. The pictures tell the story, Copy and past this link for more pictures; 

http://i1135.photobucket.com/albums/m63 6/redeyevinnie/Ruger%2010-22%20200th%20Year/IMG_0050-1.jpg

This rifle functions as well as it looks, you'll be very happy with it.
